import React from 'react'

export default function QuestionView() {
    return (
        <>
            <div className="bg-special-black w-[80%] h-[200px] rounded-2xl">
                <div name="card-header" className="flex text-white items-center justify-between">
                    <span name="question-count" className="font-bold ml-[20px] mt-[5px]">1</span>
                </div>
            </div>
        </>
    )
}
